 // pick_up_address:\'\',\n  }\n}\n\n//  Reset Form\n\nconst setFormData = (data) => {\n  resetForm({\n    values: {\n      start_date_time: data.start_date_time,\n      user_id: data.user_id,\n      pet: data.pet_id,\n      employee_id: data.employee_id,\n      facility: data.facility,\n      drop_off_date: data.dropoff_date,\n      drop_off_time: data.dropoff_time,\n      pick_up_date: data.pickup_date,\n      pick_up_time: data.pickup_time,\n      \n      dropoff_address: data.dropoff_address,\n      addition_information: data.booking_extra_info\n      //  pick_up_address:data.pickup_address,\n    }\n  })\n}\n\nconst multiSelectOption = ref({\n  mode: \'tags\',\n  closeOnSelect: true,\n  searchable: true\n})\n\nconst employee = ref({ options: [], list: [] })\nconst customer = ref({ options: [], list: [] })\n\nuseOnOffcanvasHide(\'form-offcanvas\', () => setFormData(defaultData()))\n\nonMounted(() => {\n\n  getCustomers()\n  getemployee()\n  //getPetList()\n  gettaxData()\n  getBookingprice()\n  getFacilityList()\n  getAddress()\n\n})\n\n\n\nconst getCustomers = (cb) =>\n  useSelect({ url: CUSTOMER_LIST }, { value: \'id\', label: \'full_name\' }).then((data) => {\n    customer.value = data\n    if (typeof cb == \'function\') {\n      cb()\n    }\n  })\n\nconst getemployee = (cb) =>\n  useSelect({ url: EMPLOYEE_LIST }, { value: \'id\', label: \'full_name\' }).then((data) => {\n    employee.value = data\n    if (typeof cb == \'function\') {\n      cb()\n    }\n  })\n\nconst newCustomerData = ref(null)\nconst customerSelect = (value) => {\n  getPetList(value)\n  if (_.isString(value)) {\n    newCustomerData.value = {\n      first_name: value.split(\' \')[0] || \'\',\n      last_name: value.split(\' \')[1] || \'\'\n    }\n    bootstrap.Modal.getOrCreateInstance($(\'#exampleModal\')).show()\n    user_id.value = null\n  }\n}\n// const slotSelect = () => {\n//   resetServiceTime()\n// }\n// const removeSlot = () => {\n//   resetServiceTime()\n// }\n\n//  Customer Select & Unselect & Selected Values\nconst selectedCustomer = computed(() => customer.value.list.find((customer) => customer.id == user_id.value) ?? null)\n// const selectedEmployee = computed(() => employee.value.list.find((employee) => employee.id == employee_id.value) ?? null)\n// const addCustomer = () => {}\n\nconst removeCustomer = () => {\n  user_id.value = null\n  services_id.value = []\n  selectedService.value = []\n}\n\nconst formSubmit = handleSubmit(async (values) => {\n  const saveButton = document.getElementById(\'save-button\');\n  saveButton.disabled = true; \n\n  values.type = \'boarding\'\n\n  try {\n    if (currentId.value > 0) {\n      await updateRequest({ url: UPDATE_URL, id: currentId.value, body: values }).then((res) => reset_datatable_close_offcanvas(res))\n    } else {\n      await storeRequest({ url: STORE_URL, body: values }).then((res) => reset_datatable_close_offcanvas(res))\n      document.getElementById(\'feature_image\').value = \'\';\n    }\n  } catch (error) {\n    console.error(\'Error:\', error);\n  } finally {\n    saveButton.disabled = false;  \n  }\n});\n\nconst reset_datatable_close_offcanvas = (res) => {\n  if (res.status) {\n    window.successSnackbar(res.message)\n    renderedDataTable.ajax.reload(null, false)\n    bootstrap.Offcanvas.getInstance(\'#form-offcanvas\').hide()\n    totalAmount.value = 0\n    setFormData(defaultData())\n  } else {\n    window.errorSnackbar(res.message)\n    errorMessages.value = res.all_message\n  }\n}\n\n\n<\/script>\n\n<style scoped>\n.offcanvas {\n  box-shadow: none;\n}\n.service-duration {\n  position: absolute;\n  /* padding: 2px 8px; */\n  bottom: -16px;\n  border-radius: 0;\n  border-bottom-left-radius: 4px;\n  border-bottom-right-radius: 4px;\n  right: 0;\n}\n\n.border-br-radius-0 {\n  border-bottom-right-radius: 0;\n}\n\n[dir=\'rtl\'] .border-br-radius-0 {\n  border-bottom-left-radius: 0;\n}\n.date-time {\n  border-top: 1px solid var(--bs-border-color);\n}\n.date-time > div:not(:first-child) {\n  border-left: 1px solid var(--bs-border-color);\n}\n.list-group-flush > .list-group-item {\n  color: var(--bs-body-color);\n}\n@media only screen and (min-width: 768px) {\n  .offcanvas {\n    width: 80%;\n  }\n}\n\n@media only screen and (min-width: 1280px) {\n  .offcanvas {\n    width: 60%;\n  }\n}\n</style>\n'],sourceRoot:""}]);const s=i},3645:e=>{"use strict";e.exports=function(e){var t=[];return t.toString=function(){return this.map((function(t){var n=e(t);return t[2]?"@media ".concat(t[2]," {").concat(n,"}"):n})).join("")},t.i=function(e,n,r){"string"==typeof e&&(e=[[null,e,""]]);var a={};if(r)for(var o=0;o<this.length;o++){var i=this[o][0];null!=i&&(a[i]=!0)}for(var s=0;s<e.length;s++){var l=[].concat(e[s]);r&&a[l[0]]||(n&&(l[2]?l[2]="".concat(n," and ").concat(l[2]):l[2]=n),t.push(l))}},t}},4015:e=>{"use strict";function t(e,t){return function(e){if(Array.isArray(e))return e}(e)||function(e,t){var n=e&&("undefined"!=typeof Symbol&&e[Symbol.iterator]||e["@@iterator"]);if(null==n)return;var r,a,o=[],i=!0,s=!1;try{for(n=n.call(e);!(i=(r=n.next()).done)&&(o.push(r.value),!t||o.length!==t);i=!0);}catch(e){s=!0,a=e}finally{try{i||null==n.return||n.return()}finally{if(s)throw a}}return o}(e,t)||function(e,t){if(!e)return;if("string"==typeof e)return n(e,t);var r=Object.prototype.toString.call(e).slice(8,-1);"Object"===r&&e.constructor&&(r=e.constructor.name);if("Map"===r||"Set"===r)return Array.from(e);if("Arguments"===r||/^(?:Ui|I)nt(?:8|16|32)(?:Clamped)?Array$/.test(r))return n(e,t)}(e,t)||function(){throw new TypeError("Invalid attempt to destructure non-iterable instance.\nIn order to be iterable, non-array objects must have a [Symbol.iterator]() method.")}()}function n(e,t){(null==t||t>e.length)&&(t=e.length);for(var n=0,r=new Array(t);n<t;n++)r[n]=e[n];return r}e.exports=function(e){var n=t(e,4),r=n[1],a=n[3];if(!a)return r;if("function"==typeof btoa){var o=btoa(unescape(encodeURIComponent(JSON.stringify(a)))),i="sourceMappingURL=data:application/json;ch